import React from "react";

class One extends React.Component{
    constructor(){
        super()

        this.state ={
            name : "sohail"
        }
    }

    O = () => {
        this.setState({
            name : "memon"
        })
    }

    render(){
        return(
            <div>
                <h1>{this.state.name}</h1>
                <button onClick = {O} >Press</button>
            </div>
        )
    }
}

export default One;
